import React from 'react'

export default function Game() {
  return (
    <div>
        <div className="images">
            <img src="images/rock.png" alt="" className="image" />
            <img src="images/paper.png" alt="" className="image" />
            <img src="images/scissors.png" alt="" className="image" />
        </div>


    </div>
  )
}
